import illustration from './images/illustration-working.svg';

const Homepage = () => {
    return ( 
        <main className='w-10/12 mx-auto'>
            <img 
            className=' pl-8'
            src={illustration} 
            alt='illustration' />
            <div className=' text-center'>
                <h1 className=' text-4xl my-6 font-bold'>More than just shorter links</h1>
                <p className=' text-grayishViolet mb-6'>Build your brand's recognition and get detailed 
                    insights on how your links are performing
                </p>
                <button className='bg-cYan w-40 py-2 text-white rounded-3xl'>
                    Get Started
                </button>
            </div>
        </main>
    );
}

export default Homepage;
